if exists(select * from T_USER_info where ezplay_id=p_ezplay and user_status=0)
then
	if not EXISTS (select * from t_user_info where ezplay_id=p_ezplay and TO_DAYS(last_login_ts)=TO_DAYS(CURRENT_TIMESTAMP))
	then
		update t_user_info set last_login_ts=CURRENT_TIMESTAMP where  ezplay_id=p_ezplay;
