	end if;
	select 1,p_ezplay;
elseif exists(select * from T_USER_info where ezplay_id=p_ezplay and user_status !=0)
then
	select -1;
elseif not EXISTS (select * from T_USER_info where ezplay_id=p_ezplay )
then
	insert into t_user_info(ezplay_id,user_pwd,user_status,last_login_ip,user_email,last_login_ts,login_times,user_from) select p_ezplay,111111,0,p_loginip,'default@newedge.com.cn',current_timestamp,0,0;
	select user_id into p_userid from t_user_info where ezplay_id=p_ezplay;
	
	set @x=1;
	while @x<=500 do
		
		insert into t_user_award(user_id,award_status,create_time,award_time) select p_userid,1,CURRENT_TIMESTAMP,'0000-00-00 00:00:00';
		set @x=@x+1;
	end while;
	
	select 1,p_ezplay;
else
	select -1;
end if;
END */;;
